import React from 'react';
import { BrowserRouter, Route, Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav>
      <ul>
        <li>
          <Link to="./Banner">Home</Link>
        </li>
        <li>
          <Link to="./Podcasts">Baconsale Podcast</Link>
        </li>
        <li>
          <Link to="./Movies">Movie Collection</Link>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
